import React from "react";

const Result = ({compressArray, results}) => {
    return (
        <div className="container">
            <div className="slide">
                <h3>Most Suggested <span>Job</span></h3> 
                <i className="arrow up"></i>
                <div className="line">
                </div>
                <i className="arrow down"></i>
                <h3>Least Suggested <span>Job</span></h3>
            </div>
            <div className="results">
                <ul> 
                    {compressArray(results).map((item, index) =>  <li key={index}> {item.value} </li>)}
                </ul>
            </div>


        </div>
    )
}

export default Result;
